import React from 'react';
import './Profile.css';

//funcion primaria
function Avatar() {
    return (
      <img
        className="avatar"
        src="https://i.imgur.com/1bX5QH6.jpg"
        alt="Lin Lanying"
        width={100}
        height={100}
      />
    );
  }

//Segunda funcion que se exporta con nombre de Profile que dentro retorna el componente Avatar
  export default function Profile() {
    return (
      <Avatar />
    );
}
